import React, { useEffect, useState } from "react";
import axios from "axios";
import PageTitle from "../../components/PageTitle";
import FilterMovie from "../../components/FilterMovie";

import {
  genres as genreList,
  qualities as qualityList,
  detailList,
} from "../../data";
import CatalogList from "../../components/CatalogList";
import { serverPath } from "../../constants/const";

const apiPath = `${serverPath}/api`

function CatalogPage(props) {
  const [qualities, setQualities] = useState([]);
  const [genres, setGenres] = useState([]);
  console.log(props);
  useEffect(() => {
    setGenres(genreList);
    setQualities(qualityList);
    axios.get(`${apiPath}`)
  }, []);

  return (
    <React.Fragment>
      <PageTitle title="Tìm Kiếm" location="Tìm Kiếm" />
      <FilterMovie qualities={qualities} genreList={genres} />
      <CatalogList movieList={detailList} />
    </React.Fragment>
  );
}

CatalogPage.propTypes = {};

export default CatalogPage;
